import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="page-wrapper">
      <div className="header">This is the header</div>
      <div className="main-wrapper">
        <div className="section-header">1</div>
        <div className="section-partner">2</div>
        <div className="section-explore">3</div>
        <div className="section-why-sauwallet">4</div>
        <div className="section-assets">5</div>
        <div className="section-cta">6</div>
      </div>
    </div>
  );
}

